MISSION, HISTORY, AND BENEFICIARIES;
THE MISSION OF THE DREAM PROGRAM (DREAM) IS TO BUILD COMMUNITIES OF FAMILIES AND COLLEGE STUDENTS THAT EMPOWER CHILDREN FROM DISADVANTAGED CIRCUMSTANCES TO RECOGNIZE THEIR OPTIONS, MAKE INFORMED DECISIONS, AND ACHIEVE THEIR DREAMS.  DREAM BEGAN IN 1999 AS A STUDENT RUN ORGANIZATION AT DARTMOUTH COLLEGE WORKING WITH CHILDREN FROM THE TEMPLETON COURT APARTMENTS IN WHITE RIVER JUNCTION.  THE ORGANIZATION WAS INCORPORATED AS A NONPROFIT ORGANIZATION IN 2001 AND BEGAN TO REPLICATE THEIR MODEL IN OTHER LOW-INCOME HOUSING COMMUNITIES IN VERMONT.
DREAM SERVES GOVERNMENT-SUBSIDIZED, LOW AND VERY LOW-INCOME HOUSING DEVELOPMENTS.  DREAM SERVES RESIDENTS OF THE NORTHWOODS AND HOLLOW DRIVE APARTMENTS IN WHITE RIVER JUNCTION, THE ARMORY SQUARE APARTMENTS IN WINDSOR, THE ELM STREET APARTMENTS AND FRANKLIN STREET APARTMENTS IN WINOOSKI, THE FRANKLIN SQUARE APARTMENTS IN BURLINGTON, THE GREEN ACRES AND HIGHGATE APARTMENTS IN BARRE, THE FOREST PARK APARTMENTS IN RUTLAND AND THE BIRCHWOOD MOBILE HOME PARK IN MILTON.  THESE COMMUNITIES ALL HAVE HIGH LEVELS OF POVERTY AND OTHER RISK FACTORS.

PROJECT ACTIVITIES;
THE ROLE OF THE AMERICORPS*VISTA MEMBERS WILL BE TO HELP ESTABLISH LONG-TERM INFRASTRUCTURE WITHIN DREAM IN THREE DISTINCT ORGANIZATIONAL CAPACITY-BUILDING AREAS;
*ORGANIZATIONAL DEVELOPMENT
*LOCAL PROGRAM REPLICATION AND SUPPORT
*SUMMER CAMP DEVELOPMENT.  

WHILE AMERICORPS*VISTA MEMBERS WILL FOCUS ON A DESIGNATED AREA OF DREAM, THEY WILL ALSO BE EXPOSED TO ALL AREAS OF OPERATION AND GIVEN OPPORTUNITIES TO PURSUE THEIR INTERESTS INCLUDING STRATEGIC PLANNING FOR THE ORGANIZATION AND DEVELOPMENT WORK.
